Nuts is a weekly lad mag published in the United Kingdom. It was the first weekly 

lads magazine to be published in the UK[citation needed] and is sold every Tuesday 

(originally every Thursday). Nuts marketing campaign uses a slogan, &quot;When You Really 

Need Something Funny&quot;.
